import React, { useEffect, useState } from 'react';
import PostCardsList from '../components/PostCartsList';

const Main = ({postService}) => {
  const [posts, setPosts] = useState()

  useEffect(() => {
    postService
      .getPosts()
      .then((data) => setPosts(data))
      .catch(console.error())
  }, [postService])

  console.log(posts)
  return (
    <main className='main'>
      {/* <PostCardsList posts={posts} /> */}
    </main>
  )
}

export default Main;
